import React from "react";
import {
  BrowserRouter as Router,
  Route,
  Routes
} from "react-router-dom";
import Home from "./component/Home"
import Display from "./component/Display"


const App = () => {
  return (
    <div>hello
    <Routes>

        <Route path="/" element={<Home />} />
        <Route path="/Display" element={<Display />} />


    </Routes>
    </div>
  );
}

export default App;
